class Welcome extends React.Component {
  render() {
    return (
      <header>
        <Nav defaultActiveKey="/home" as="ul">
          <Nav.Item as="li">
            <Nav.Link href="/help">Help?</Nav.Link>
          </Nav.Item>
          <Nav.Item as="li">
            <Nav.Link href="/reset">Start Over</Nav.Link>
          </Nav.Item>
        </Nav>
      <h1>Are you Hot or Cold?</h1>
      </header>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Welcome />
      <FormApp />
      <h3>FOOTER</h3>
    </div>
  );
}

export default App;
